import React from "react";

import Singing from "../components/Singing";
import Signup from "../components/Signup";

const SingUpScreen = () => {
  return (
    <div className="w-screen flex justify-center items-center">
      <Signup />
      <Singing />
    </div>
  );
};

export default SingUpScreen;
